import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faLinkedinIn } from "@fortawesome/free-brands-svg-icons";

function AboutMe() {
    return (

        <div class="flex flex-col border-2 border-black w-1/2 h-48 justify-around">
            <div class="text bold font-mono">
                - HELLO !
            </div>
            <div class="text-5xl bold font-sans">
                I'm Raymond Halim
            </div>
            <div class="text-m font-serif">
                I am a Bachelor of Computer Science graduate from University of Wollongong - Singapore Institute of Management.
            </div>

            <div class="flex border border-black">
                <a href= "" >
                    <FontAwesomeIcon icon={faLinkedinIn}/>
                </a>
            </div>
        </div>
    );
}

export default AboutMe;
